init_eqs_eel:
mv_x=64;mv_y=48;
nut=0;
stp=0;stq=0;
rtp=0;rtq=0;
wvr=0;
decay=0;
dcsp=0;
q1=0;q2=0;q3=0;

frame_eqs_eel:
t = time*2.3;
t2 = sin(treb_att+mid_att)*2.89;
t3 = sin(mid_att+treb_att)*2.23;
wave_x = wave_x + 0.350*( 0.70*sin(2.221+bass_att) + 0.30*sin(1.821*time) );
wave_y = wave_y + 0.350*( 0.30*sin(1.942*time) + 0.70*sin(2.522+bass_att) );
wave_r = wave_r + 0.790*( 0.60*sin(0.823*t3) + 0.40*sin(0.916*t2) );
wave_g = wave_g + 0.790*( 0.60*sin(0.900*t2) + 0.40*sin(1.023*t2) );
wave_b = wave_b + 0.790*( 0.60*sin(0.808*t2) + 0.40*sin(0.949*t3) );
rot = rot + 0.010*( 0.60*sin(0.038*time) + 0.40*sin(0.054*time) );
dx = dx + 0.002*( 0.60*sin(0.434*time) + 0.40*sin(0.277*time) );
dy = dy + 0.002*( 0.60*sin(0.384*time) + 0.40*sin(0.477*time) );
//zoom = (sin(treb_att-mid_att));
warp = (sin(time)/2)-(bass_att-mid_att);

decay=1;
//zoom=1.000;
speed=0.80;
speedinv=1-speed;
q1=(qa*speed + bass*speedinv);
q2=(qb*speed + mid *speedinv);
q3=(qc*speed + treb*speedinv);
qa=q1;
qb=q2;
qc=q3;
flux=sin(time/2);
q4=flux * 0.5 + 0.5;
q5=flux;

comp:
shader_body { 
 vec4 tmpvar_1;
 tmpvar_1.w = 1.0;
 tmpvar_1.xyz = (texture (sampler_main, uv).xyz + (clamp (
   ((((texture (sampler_blur2, uv).xyz * scale2) + bias2) * 2.8) - 0.13)
 , 0.0, 1.0) * vec3(1.4, 0.3, 1.3)));
 ret = tmpvar_1.xyz;
}

comp_hlsl:
shader_body
{
    ret = tex2D(sampler_main, uv).xyz;
    ret += saturate(GetBlur2(uv)*2.8 - 0.13)*float3(1.4,0.3,1.3);
}
